This torrent collects the two Image comics miniseries entitled Guarding The Globe, byt The Walking Dead writer Robert Kirkman and featuring his character Invincible. Basically it is a team of the best heroes coming together to tackle massive threats, and to quote from the promo info - &quot;Your favorite heroes - Brit, Invincible, Best Tiger, Robot, Yeti, Kaboomerang, and more - face new challenges of epic proportions.&quot;

Each series has six issues; the first volume is all by Minutemen-TwiztiD-T and MM-DTs. The second volume is all digital copies by Empire scanners Zone, Nahga and JK. Thanks to ALL the scanners for their hard work and effort; please seed and enjoy! :-)

